// see whether device supports touch events (a bit simplistic, but...)
var hasTouch = ("ontouchstart" in window);
// hook touch events for drop-down menus
// NB: if has touch events, then has standards event handling too
if (hasTouch && document.querySelectorAll) {
  var i, len, element,
    dropdowns = document.querySelectorAll("#top-navigation-wrap li.children > a");

  function menuTouch(event) {
    // toggle flag for preventing click for this link
    var i, len, noclick = !(this.dataNoclick);
    // reset flag on all links
    for (i = 0, len = dropdowns.length; i < len; ++i) {
      dropdowns[i].dataNoclick = false;
    }
    // set new flag value and focus on dropdown menu
    this.dataNoclick = noclick;
    this.trigger('focus');
  }

  function menuClick(event) {
    // if click isn't wanted, prevent it
    if (this.dataNoclick) {
      event.preventDefault();
    }
  }
  for (i = 0, len = dropdowns.length; i < len; ++i) {
    element = dropdowns[i];
    element.dataNoclick = false;
    element.addEventListener("touchstart", menuTouch, false);
    element.addEventListener("click", menuClick, false);
  }
  // User account drop down toggle on touch screen
  $(document).on("click", ".profile-setting", function() {
    $(this).find(".profile-drop-down-menu").toggle();
    $(this).find("a.profile-name").toggleClass("collapsed");
    $(this).find("a.profile-name").toggleClass("expanded");
  })
} else {
  // User account drop down hover effect on non - touch screen
  $(".profile-setting").on("mouseover",function() {
    $(this).find(".profile-drop-down-menu").show();
    $(this).find("a.profile-name").removeClass("collapsed");
    $(this).find("a.profile-name").addClass("expanded");
  }).on("mouseout",function() {
    $(this).find(".profile-drop-down-menu").hide();
    $(this).find("a.profile-name").removeClass("expanded");
    $(this).find("a.profile-name").addClass("collapsed");
  })
}
$(document).on("keypress", ".profile-setting", function(event) {
  if (event.which === 32) {
    event.stopPropagation;
    if ($(this).find('.profile-drop-down-menu:visible').length) {
      $(this).trigger("mouseout");
    } else {
      $(this).trigger("mouseover");
    }
    return false
  }
  return true
})
