/**
 *
 * @param {Object} event
 * @param {Object} object
 * @classDescription: This event is used to restrict user to enter more than 2 decimal places.
 */

function validate_float(event, object){
    if ((event.which == 0) || (event.which == 8)) {
        return true;
    }
    else {
        if ((event.which >= 58 && event.which < 65) || (event.which >= 64 && event.which < 91) || (event.which >= 33 && event.which < 46) || (event.which >= 91 && event.which < 127) || (event.which >= 47 && event.which < 48) || (event.which >= 191 && event.which < 223)) {
            service_charge_flag = false;

        }
        else {

            var service_charge = $(object).val();
            service_charge_array = service_charge.split(".");
            var service_charge_flag = true;
            if (service_charge_array != null) {
                if (service_charge_array[1] != null) {
                    if (service_charge_array[1].length > 1) {
                        service_charge_flag = false;
                    }
                }
            }
        }
        return service_charge_flag;
    }

}

