function strip_tags(str) {
    t = str.replace(/<(\/)?(html|head|title|body|h1|h2|h3|h4|h5|h6|p|br|hr|pre|em|strong|code|b|i|a|ul|li|ol|dl|dd|table|tr|th|td)([^>]*)>/gi, "");
    t = t.replace(/<(\/)?(iframe|frameset|form|input|select|option|textarea|blackquote|address|object)([^>]*)>/gi, "");
    return t;
}

//Sanjay [24/07/14] : Javascript based widget implementation for the latest_event
$().ready(function() {
    if ($("#latest-events.uc-latest-event-widget-new").length > 0) {
        $("#latest-events.uc-latest-event-widget-new").each(function() {
            var event_type_class = $(this).prop('class');

            var page_id = event_type_class.substring(event_type_class.indexOf('_') + 1);
            display_event_widget_path = rewrite_url_for_js("/widget/display_event_widget");
            $.ajax({
                type: "GET",
                url: display_event_widget_path,
                style: "inherit",
                dataType: 'script',
                data: "page_id=" + page_id
            }).done(function(data) {
                result = JSON.parse(data);
                //Getting all required widget configuration values from hidden field added in the widget partial
                var widget_class = '.event-type-widget_' + page_id
                page_image = $(widget_class + " #widget_display_image").val();
                page_description = $(widget_class + " #widget_page_description").val();
                page_quick_link_ticket_booking = $(widget_class + " #widget_quick_link_ticket_booking").val();
                page_link_header = $(widget_class + " #widget_page_header").val();
                page_redirect_link = $(widget_class + " #widget_page_redirect").val();
                page_link_name_display = $(widget_class + " #widget_page_title").val();
                show_buy_ticket_link = (page_quick_link_ticket_booking.toString() === "true" && page_image.toString() === "true" && page_description.toString() === "true");
                var li_obj = '';
                var initial_div_obj = '';
                var i = 0;
                var status = false;
                var is_bespoke_subsite = false;

                //Implementing the header link of widget
                if (page_link_header == 'true') {
                    initial_div_obj = initial_div_obj + '<div class="event-widget-header"><a href ="' + page_redirect_link + '" >' + page_link_name_display + '</a></div>';
                }
                //Adding condition based class for displaying event thumnail with description
                if (page_image == 'true' || page_description == 'true') {
                    initial_div_obj = initial_div_obj + '<div class="event-widget with-image-description">';
                } else {
                    initial_div_obj = initial_div_obj + '<div class="event-widget">';
                }
                //Iterating the indevidual event and forming the widget contents.

                $(result[0]).each(function(idx, obj) {
                    status = (result[1][i] > 0) && (result[2][i] > 0) && result[3][i]; // && (result[3][i] > 0);
                    is_bespoke_subsite = (result[4][i] != null && obj.is_bespoke_subsite == true);
                    var date_value = result[6][i];
                    if (page_image == 'true') {
                        var event_path = rewrite_url_for_js(result[5][i]);
                        if ((show_buy_ticket_link.toString() === "true" && status.toString() === "true")) {
                            //Displaying the book ticket link on the event image
                            li_obj = li_obj + '<li><div class="event-thumbnail"><a href="' + event_path + '" class="uc-events-widget-buy-ticket">' + I18n.t('book_ticket') + '</a>' + '<a href="' + event_path + '"><img alt="Events_icons" src="' + obj.logo_file_name + '"/></a>' + '</div> <div class="event-content">';
                        } else {
                            li_obj = li_obj + '<li><div class="event-thumbnail"><a href="' + event_path + '"><img alt="Events_icons" src="' + obj.logo_file_name + '"/></a></div><div class="event-content">';
                        }
                    } else {
                        li_obj = li_obj + '<li>';
                    }

                    if(result[7]["widget_name"] == "Latest Events"){
                      var classes = result[7]['event_tags'][idx] + ' ' +result[7]['event_types'][idx]
                      li_obj = li_obj.replace ('<li>', '<li class="event ' + classes + '">')
                    }

                    if (is_bespoke_subsite) {
                        li_obj = li_obj + '<div class="date"> <a href="' + rewrite_url_for_js(result[4][i].page_path) + '">' + date_value + ' </a></div>';
                    } else if (is_bespoke_subsite && obj.eventable.page != null && obj.eventable.page.page_path != null) {
                        li_obj = li_obj + '<div class="date"> <a href="' + rewrite_url_for_js("/events/" + obj.slug) + '">' + date_value + ' </a></div>';
                    } else {
                        li_obj = li_obj + '<div class="date"> <a href="' + rewrite_url_for_js(result[5][i]) + '">' + date_value + ' </a></div>';
                    }

                    if (obj.is_bespoke_subsite != null && result[4][i] != null && obj.is_bespoke_subsite == true) {
                        if (obj.is_bespoke_subsite == true) {
                            if (result[4][i].target_window == 'newwindow') {
                                li_obj = li_obj + '<div class="name"><a href="' + rewrite_url_for_js(result[4][i].page_path) + '" id="' + obj.id + '" onclick="window.open(this.href);return false;">' + obj.name + ' </a></div>';
                            } else {
                                li_obj = li_obj + '<div class="name"><a href="' + rewrite_url_for_js(result[4][i].page_path) + '" >' + obj.name + ' </a></div>';
                            }
                        } else if (obj.is_bespoke_subsite && obj.eventable.page != null && obj.eventable.page.page_path != null) {
                            li_obj = li_obj + '<div class="name"><a href="' + rewrite_url_for_js(obj.eventable.page.page_path + "/events/" + obj.slug) + '" >' + obj.name + ' </a></div>';
                        }
                    } else {
                        li_obj = li_obj + '<div class="name"><a href="' + rewrite_url_for_js(result[5][i]) + '" >' + obj.name + ' </a></div>';
                    }

                    if (page_description == 'true') {
                        if (obj.description != null) {
                            var plain_desc = strip_tags(obj.description);
                            if (plain_desc.length > 100) {
                                plain_desc = obj.description.slice(0, 100) + "...";
                                li_obj = li_obj + '<div class="event-description">' + plain_desc + '</div>';
                            } else {
                                li_obj = li_obj + '<div class="event-description">' + plain_desc + '</div>';
                            }
                        }
                        li_obj = li_obj + '<div class="clear"></div>';

                        if (page_image == 'true') {
                            li_obj = li_obj + '</div>';
                        }
                    }
                    li_obj = li_obj + '<div class="clear"></div>' + '</li>';
                    i++;
                });
                var last_div = '';
                last_div = last_div + '<div class="uc-more-event-link-wrapper"><a href="' + rewrite_url_for_js("/events") + '" class="more more-events">' + I18n.t('more_events') + '</a></div>';
                last_div = last_div + '<div class="clear"></div></div>';

                //forming the final DOM object and appending it to latest_event DOM
                var val = navigator.userAgent.toLowerCase();
                if ($.browser.msie) {
                    $(widget_class).append(initial_div_obj + '<ul class="top-events"> ' + li_obj + '</ul></div>').append('' + last_div);
                } else {
                    $(widget_class).append(initial_div_obj + '<ul class="top-events"> ' + li_obj + '</ul></div>').append(last_div);
                }

                if (page_image == 'true' || page_description == 'true') {
                    $('.event-widget.with-image-description').jcarousel({
                        vertical: true,
                        scroll: 1
                    });
                }
            });
        });
    }
});
var offset = 10;
var search_count = null;
var search_text_to_search = null;

$(function() {


	if ($("#uc-load_search_button").val() == "false"){
		$('#uc-more-search').hide();
	}

	search_count = $("#search_result").val();
	$(document).on("click", '#uc-more-search', function() {
		search_text_to_search = $("#search_text_to_search").val();
		offset = offset + 10;

		$.ajax({
			type : "GET",
			style : "inherit",
			dataType : 'script',
			url : "/pages/more_search_result?offset="+offset +"&site_search="+search_text_to_search,
		    }).done(function(data) {
			    if ($("#uc-load_search_button").val() == "false"){
					$('#uc-more-search').hide();
				}
		    });


	});
});

function WiceGridProcessor(name, base_request_for_filter, base_link_for_show_all_records,
                      link_for_export, parameter_name_for_query_loading, parameter_name_for_focus, environment){

   this.checkIfJsFrameworkIsLoaded = function(){
     if (! jQuery){
       alert("jQuery not loaded, WiceGrid cannot proceed!")
     }
   }

  this.checkIfJsFrameworkIsLoaded();
  this.name = name;
  this.parameter_name_for_query_loading = parameter_name_for_query_loading;
  this.parameter_name_for_focus = parameter_name_for_focus;
  this.base_request_for_filter = base_request_for_filter;
  this.base_link_for_show_all_records = base_link_for_show_all_records;
  this.link_for_export = link_for_export;
  this.filter_declarations = new Array();
  this.environment = environment;

  this.toString = function(){
    return "<WiceGridProcessor instance for grid '" + this.name + "'>";
  }


  this.process = function(dom_id_to_focus){
    window.location = this.build_url_with_params(dom_id_to_focus);
  }

  this.reload_page_for_given_grid_state = function(grid_state){
    var request_path = this.grid_state_to_request(grid_state);
    window.location = this.append_to_url(this.base_link_for_show_all_records, request_path);
  }

  this.load_query = function(query_id){
    var request = this.append_to_url(this.build_url_with_params(),
      (this.parameter_name_for_query_loading +  encodeURIComponent(query_id)));
    window.location = request;
  }

  this.save_query = function(field_id, query_name, base_path_to_query_controller, grid_state, input_ids){
    if (input_ids instanceof Array) {
      input_ids.each(function(dom_id){
        grid_state.push(['extra[' + dom_id + ']', $('#'+ dom_id)[0].value])
      });
    }

    var request_path = this.grid_state_to_request(grid_state);

    jQuery.ajax({
      url: base_path_to_query_controller,
      async: true,
      data: request_path + '&query_name=' + encodeURIComponent(query_name),
      dataType: 'script',
      success: function(){$('#' + field_id).val('')},
      type: 'POST'
    });
  }

  this.grid_state_to_request = function(grid_state){
    return jQuery.map(grid_state, function(pair){
      return encodeURIComponent(pair[0]) + '=' + encodeURIComponent(pair[1]);
    }).join('&');
  }


  this.append_to_url = function(url, str){
    var sep;
    if (url.indexOf('?') != -1){
      if (/[&\?]$/.exec(url)){
        sep = '';
      }else{
        sep = '&';
      }
    }else{
      sep = '?';
    }
    return url + sep + str;
  }


  this.build_url_with_params = function(dom_id_to_focus){
    var results = new Array();
    var _this =  this;
    jQuery.each(this.filter_declarations, function(i, filter_declaration){
      param = _this.read_values_and_form_query_string(
        filter_declaration.filter_name, filter_declaration.detached,
        filter_declaration.templates, filter_declaration.ids);
      if (param && param != ''){
        results.push(param);
      }
    });

    var res = this.base_request_for_filter;
    if ( results.length != 0){
      all_filter_params = results.join('&');
      res = this.append_to_url(res, all_filter_params);
    }
    if (dom_id_to_focus){
      res = this.append_to_url(res, this.parameter_name_for_focus + dom_id_to_focus);
    }
    return res;
  }

  this.reset = function(){
    window.location = this.base_request_for_filter;
  }

  this.export_to_csv = function(){
    window.location = this.link_for_export;
  }

  this.register = function(func){
    this.filter_declarations.push(func);
  }

  this.read_values_and_form_query_string = function(filter_name, detached, templates, ids){
    var res = new Array();
    for(i = 0; i < templates.length; i++){
      if($(ids[i]) == null){
        if (this.environment == "development"){
          message = 'WiceGrid: Error reading state of filter "' + filter_name + '". No DOM element with id "' + ids[i] + '" found.'
          if (detached){
            message += 'You have declared "' + filter_name +
              '" as a detached filter but have not output it anywhere in the template. Read documentation about detached filters.'
          }
          alert(message);
        }
        return '';
      }
      var el = $('#' + ids[i]);
      var val;
      if (el[0] && el[0].type == 'checkbox'){
        if (el[0].checked) val = 1;
      } else {
        val = el.val();
      }
      if (val instanceof Array) {
        for(j = 0; j < val.length; j++){
          if (val[j] && val[j] != "")
            res.push(templates[i] + encodeURIComponent(val[j]));
        }
      } else if (val &&  val != ''){
        res.push(templates[i]  + encodeURIComponent(val));
      }
    }
    return res.join('&');
  }

};

function toggle_multi_select(select_id, link_obj, expand_label, collapse_label) {
  var select = $('#' + select_id)[0];
  if (select.multiple == true) {
    select.multiple = false;
    link_obj.title = expand_label;
  } else {
    select.multiple = true;
    link_obj.title = collapse_label;
  }
}

