$(function() {
    $('.chart-heading-info').tooltip({
      classes: {
        "ui-tooltip": "tip-yellowsimple",
        "ui-tooltip-content": "tip-inner"
      },
      content: function() {
        return $(this).prop('title')
      }
    });

    $( document ).on( "mousedown", ".uc-election-dashboard * a[data-remote]", function(e) {
        if (e.which === 2) {
            alert(I18n.t('ajax_middle_click_msg'))
            return false;
        }
    });

    $('.uc-widget-election-statistics-wrapper').ajaxStart(function() {
        $.blockUI({
            overlayCSS: {
                backgroundColor: '#000'
            },
            message: '<img src="/assets/default/unioncloud-processing.gif" alt=""/><h1>'+I18n.t('please_wait_on_processing')+'</h1>',
            css: {
                backgroundColor: 'none',
                border: '0px solid #000000',
                padding: '10px 10px 10px'
            }
        });
    });
    $('.uc-widget-election-statistics-wrapper').ajaxStop(function() {
        blockUI_section_wise();
    });
    $( document ).on( "click", ".uc-top-turnouts-tabs-wrapper li a", function(e) {
        if ($(this).parent("li").hasClass("active")) {
            e.preventDefault();
        } else {
            $('#election_top_turnouts .uc-top-turnouts-tabs-content').html('<div class="uc-ajax-loader"><img src="/assets/default/ajax-preloader.gif" alt="Ajax preloader"></div>');
        }

    });
    $( document ).on( "click", ".toggle-timeline", function(e) {
        $(this).closest(".uc-timeline-wrapper").find(".uc-timeline-listing").slideToggle("fast", function() {
            var viewvisible = $(this).closest(".uc-timeline-wrapper").find(".uc-timeline-listing").is(":visible");
            if (viewvisible == true) {
                $(this).closest(".uc-timeline-wrapper").removeClass("collapsed");
            } else {
                $(this).closest(".uc-timeline-wrapper").addClass("collapsed");
            }
        });
    });
    $( document ).on( "click", ".toggle-navigation", function(e) {
        $(this).closest(".uc-election-dashboard-navigation").find(".uc-election-navigation-wrapper").slideToggle("fast", function() {
            var viewvisible = $(this).closest(".uc-election-dashboard-navigation").find(".uc-election-navigation-wrapper").is(":visible");
            if (viewvisible == true) {
                $(this).closest(".uc-election-dashboard-navigation").removeClass("collapsed");
            } else {
                $(this).closest(".uc-election-dashboard-navigation").addClass("collapsed");
            }
        });
    });
    $( document ).on( "click", ".uc-votes-tabs li", function(e) {
        $(".uc-votes-tabs li").removeClass("active");
        $(this).addClass("active");
        var getclassname = $(this).attr("class").split(' ')[0];
        if (getclassname == "uc-total-tab") {
            $(".uc-graph-content").hide();
            $(".total-graph").show();
            $(".today-graph").hide();
            $(".last-hour-graph").hide();
            $(".last-day-graph").hide();
        } else if (getclassname == "uc-today-tab") {
            $(".uc-graph-content").hide();
            $(".today-graph").show();
            $(".total-graph").hide();
            $(".last-hour-graph").hide();
            $(".last-day-graph").hide();
        } else if (getclassname == "uc-last-day-tab") {
            $(".uc-graph-content").hide();
            $(".last-day-graph").show();
            $(".total-graph").hide();
            $(".last-hour-graph").hide();
            $(".today-graph").hide();
        } else if (getclassname == "uc-lasthour-tab") {
            $(".uc-graph-content").hide();
            $(".last-hour-graph").show();
            $(".total-graph").hide();
            $(".today-graph").hide();
            $(".last-day-graph").hide();
        }
        if ($(window).width() < 800) {
            $(window).trigger('resize');
        }
    });

    var screenSizes_xs = 480;
    var screenSizes_sm = 768;
    var screenSizes_md = 992;
    var screenSizes_lg = 1200;


    if ($(window).width() < (screenSizes_sm - 1)) {
        $(".uc-election-dashboard-navigation").addClass("collapsed");
        $(".uc-timeline-wrapper").addClass("collapsed");
    } else {
        $(".uc-election-dashboard-navigation").removeClass("collapsed");
        $(".uc-timeline-wrapper").removeClass("collapsed");
        $(".uc-election-navigation-wrapper").removeAttr("style");
        $(".uc-timeline-listing").removeAttr("style");
    }

    $(window).on("resize",function() {
        if ($(window).width() < (screenSizes_sm - 1)) {
            $(".uc-election-dashboard-navigation").addClass("collapsed");
            $(".uc-timeline-wrapper").addClass("collapsed");
        } else {
            $(".uc-election-dashboard-navigation").removeClass("collapsed");
            $(".uc-timeline-wrapper").removeClass("collapsed");
            $(".uc-election-navigation-wrapper").removeAttr("style");
            $(".uc-timeline-listing").removeAttr("style");
        }
    });
});

function generate_piechart(selector, data) {
    if (jQuery.type(data)) {
        a = data.replace(/'/g, '"');
        graph_data = JSON.parse(a);
    } else {
        graph_data = data;
    }
    var pie_wrapper_width = $("#election_leading_gender .uc-lg-voteshare-wrapper:first").outerWidth();
    var pieSize = "80%";
    var pieInnerSize = "30%";
    var labelConnectorDistance = 10;
    if (pie_wrapper_width < 400) {
        pieSize = "60%";
        pieInnerSize = "20%";
    }
    if (pie_wrapper_width > 600) {
        labelConnectorDistance = 20;
    }
    var colorHash = {
        'female': '#05d5a7',
        'male': '#2b908f',
        'other': '#7798bf',
        'non-binary': '#f45b5b',
        'unknown': '#ffcc00'
    };
    colors_arr = [];
    graph = [];
    if ($.isArray(graph_data)) {
        for (i = 0; i <= graph_data.length; i++) {
            if (graph_data[i] && graph_data[i][0]) {
                colors_arr.push(colorHash[graph_data[i][0]]);
                var h = {};
                h.name = I18n.t(graph_data[i][0]);
                h.y = graph_data[i][1];
                h.vote_count = graph_data[i][2];
                graph.push(h);
            }

        }
    }
    $(selector).highcharts({
        chart: {
            type: 'pie',
            options3d: {
                enabled: true,
                alpha: 45
            },
            margin: [0, 0, 0, 0],
            spacingTop: 0,
            spacingBottom: 0,
            spacingLeft: 0,
            spacingRight: 0
        },
        tooltip: {
            pointFormat: '{series.name}: <b>{point.percentage:.2f} %</b> <br/>' + I18n.t('voter_cnt_tooltip') + ': {point.vote_count}'
        },
        title: {
            text: null
        },
        colors: colors_arr,
        credits: {
            enabled: false
        },
        subtitle: {
            text: null
        },
        plotOptions: {
            pie: {
                size: pieSize,
                innerSize: pieInnerSize,
                depth: 45,
                dataLabels: {
                    enabled: true,
                    distance: labelConnectorDistance
                }
            }
        },
        series: [{
            name: I18n.t('voter_share_series_name'),
            data: graph
        }]
    });
}

function widget_ajax_call(url, query_string, stop_blockUI) {
    stop_blockUI = stop_blockUI || false;
    $.ajax({
        type: "GET",
        url:  rewrite_url_for_js(url),
        data: query_string
    }).done(function(msg) {
        //$.unblockUI();
        return false;
    });
}

function fetch_election_dashboard() {
    var vote_type_tab = 0;
    if ($('.uc-total-tab').hasClass('active')) {
        vote_type_tab = 0;
    } else if ($('.uc-today-tab').hasClass('active')) {
        vote_type_tab = 1;
    } else if ($('.uc-lasthour-tab').hasClass('active')) {
        vote_type_tab = 2;
    } else if ($('.uc-last-day-tab').hasClass('active')) {
        vote_type_tab = 3;
    }
    var election_id = "";
    $("#election_statistics_widget_configured_election_id option:selected").each(function() {
        election_id = $(this)[0].value;
    });
    var page_id = $("#uc-election-dashboard").data("page");
    $("#election_leading_gender .uc-leading-gender-graph").html("<div class='uc-ajax-loader'><img src='/assets/default/ajax-preloader.gif' alt='Ajax Loader'></div>");
    $("#election_study_types .uc-study-types-wrapper").html("<div class='uc-ajax-loader'><img src='/assets/default/ajax-preloader.gif' alt='Ajax Loader'></div>");
    $("#election_schools .uc-schools-wrapper").html("<div class='uc-ajax-loader'><img src='/assets/default/ajax-preloader.gif' alt='Ajax Loader'></div>");
    $('#election_statistics_widget_configured_election_id').ajaxStart(function() {
        $.blockUI({
            overlayCSS: {
                backgroundColor: '#000'
            },
            message: '<img src="/assets/default/unioncloud-processing.gif" alt=""/><h1>'+I18n.t('please_wait_on_processing')+'</h1>',
            css: {
                backgroundColor: 'none',
                border: '0px solid #000000',
                padding: '10px 10px 10px'
            }
        });
    });
    //var total_voters = $("ul#uc-election-nav").data("total-voters");
    if ($('.uc-election-navigation-wrapper li.study_type').hasClass('active')) {
        widget_ajax_call("../widget/display_election_study_types.html", "render_as=tab&election_id=" + election_id + "&page_id=" + page_id, true);
    } else if ($('.uc-election-navigation-wrapper li.school').hasClass('active')) {
        widget_ajax_call("../widget/display_election_schools.html", "render_as=tab&election_id=" + election_id + "&page_id=" + page_id, true);
    } else if ($('.uc-election-navigation-wrapper li.age-range').hasClass('active')) {
        widget_ajax_call("../widget/display_election_age_range.html", "election_id=" + election_id + "&page_id=" + page_id, true);
    } else if ($('.uc-election-navigation-wrapper li.program').hasClass('active')) {
        widget_ajax_call("../widget/display_election_top_turnout.html", "render_as=tab&turnout_tab=program&election_id=" + election_id + "&page_id=" + page_id, true);
    } else if ($('.uc-election-navigation-wrapper li.hall').hasClass('active')) {
        widget_ajax_call("../widget/display_election_top_turnout.html", "render_as=tab&turnout_tab=hall&election_id=" + election_id + "&page_id=" + page_id, true);
    } else if ($('.uc-election-navigation-wrapper li.group').hasClass('active')) {
        widget_ajax_call("../widget/display_election_top_turnout.html", "render_as=tab&turnout_tab=group&election_id=" + election_id + "&page_id=" + page_id, true);
    } else {
        widget_ajax_call("../widget/get_election_widget_data.html", "election_id=" + election_id + "&vote_div_tab=" + vote_type_tab + "&page_id=" + page_id, true);
    }
}

function generate_percentage_donut_chart(selector, percentage, name, position) {
    var graph_data = [{
        name: name,
        y: percentage
    }, {
        name: " ",
        y: (100 - percentage),
        color: "#eee"
    }];
    var colorArray = ["#05d5a7", "#7798bf", "#f45b5b", "#fc6eb7", "#c85bfd"];
    var donutChartOptions = {
        chart: {
            backgroundColor: 'rgba(255, 255, 255, 1)',
            margin: [0, 0, 0, 0],
            renderTo: selector,
            spacing: [0, 0, 0, 0],
            type: 'pie'
        },
        colors: [colorArray[position]],
        credits: {
            enabled: false
        },
        exporting: {
            enabled: false
        },
        legend: {
            enabled: false
        },
        plotOptions: {
            series: {
                dataLabels: {
                    enabled: false
                }
            },
            pie: {
                allowPointSelect: false,
                dataLabels: {
                    connectorWidth: 0,
                    enabled: false
                },
                shadow: false,
                states: {
                    hover: {
                        enabled: false
                    }
                },
            },
        },
        tooltip: {
            enabled: false
        },
        series: [{
            data: graph_data,
            name: "",
            size: 145,
            innerSize: 130,
            pointPadding: 0,
            groupPadding: 0
        }],
        template: 'donut',
        title: {
            align: 'center',
            style: {
                color: colorArray[position],
                fontFamily: 'Arial, Helvetica, sans',
                fontSize: '22px',
                fontWeight: 'bold'
            },
            text: name + "%",
            verticalAlign: 'middle',
            y: 5
        }
    };
    $(selector).highcharts(donutChartOptions);
}
