function generate_negative_stack_graph(selector, categories, data) {
    Highcharts.setOptions({ lang: highchart_translation[I18n.locale] });
    if (categories && categories.length > 0) {
        no_bar = categories.length;
        var setheight = no_bar > 3 ? ((40 * no_bar) + 200) : 300;
        labelWidth = "100px";
        pointWidth = 15;
        truncateLabelOn = 30;
        if ($(".uc-election-dashboard-wrapper").width() < 700) {
            labelWidth = "50px";
            pointWidth = 20;
            truncateLabelOn = 20;
        }
        exportingMenuItems = [{
            textKey: 'printChart',
            onclick: function() {
                this.print();
            }
        }, {
            separator: true
        }]
        if (no_bar < 600) {
            exportingMenuItems = $.merge(exportingMenuItems, [{
                textKey: 'downloadPNG',
                onclick: function() {
                    this.exportChart();
                }
            }])
        }
        if (no_bar < 900) {
            exportingMenuItems = $.merge(exportingMenuItems, [{
                textKey: 'downloadJPEG',
                onclick: function() {
                    this.exportChart({
                        type: 'image/jpeg'
                    });
                }
            }])
        }
        exportingMenuItems = $.merge(exportingMenuItems, [{
            textKey: 'downloadPDF',
            onclick: function() {
                this.exportChart({
                    type: 'application/pdf'
                });
            }
        }, {
            textKey: 'downloadSVG',
            onclick: function() {
                this.exportChart({
                    type: 'image/svg+xml'
                });
            }
        }])
        var chartoptions = {
            chart: {
                type: 'bar',
                zoomType: 'xy',
                events: {
                    load: function(event) {
                        //alert ('Chart loaded');
                        $(".turnout_chart_wrapper .uc-ajax-loader").remove();
                    }
                },
                height: setheight
            },
            title: {
                text: null
            },
            legend: {
                verticalAlign: 'top',
                floating: false,
                backgroundColor: '#FFFFFF'
            },
            subtitle: {
                text: null
            },
            credits: {
                enabled: false
            },
            exporting: {
                buttons: {
                    contextButton: {
                        menuItems: exportingMenuItems
                    }
                }
            },
            xAxis: [{
                categories: categories,
                reversed: false,

                labels: {
                    step: 1,
                    style: {
                        lineHeight: 15,
                        width: labelWidth,
                        wordWrap: "break-word"
                    },
                    formatter: function() {
                        if (this.value && this.value.length > truncateLabelOn) {
                            return this.value.substr(0, truncateLabelOn) + "...";
                        } else {
                            return this.value;
                        }
                    }
                }
            }, { // mirror axis on right side
                opposite: true,
                reversed: false,
                categories: categories,
                linkedTo: 0,

                labels: {
                    step: 1,
                    style: {
                        lineHeight: 15,
                        width: labelWidth,
                        wordWrap: "break-word"
                    },
                    formatter: function() {
                        if (this.value.length > truncateLabelOn) {
                            return this.value.substr(0, truncateLabelOn) + "...";
                        } else {
                            return this.value;
                        }
                    }
                }
            }],
            yAxis: {
                title: {
                    text: null
                },
                labels: {
                    formatter: function() {
                        return Math.abs(this.value) + '%';
                    }
                },
                min: -100,
                max: 100
            },

            plotOptions: {
                series: {
                    stacking: 'normal',
                    pointWidth: pointWidth
                }
            },

            tooltip: {
                formatter: function() {
                    str = '<b>' + this.point.category + '</b><br/>'
                    str += this.series.name + ': ' + Highcharts.numberFormat(Math.abs(this.point.y), 2) + ' % '
                    if (this.point.v) {
                        str += '<br/>'+I18n.t('voters_tooltip')+': ' + this.point.v
                    }
                    if (this.point.e) {
                        str += '<br/>'+I18n.t('eligible_voters_tooltip')+': ' + this.point.e
                    }
                    return str;
                }
            },

            series: data
        };
        $(selector).highcharts(chartoptions);
    } else {
        $(".uc-election-dashboard-wrapper .turnout_chart_wrapper").html('<div class="uc-no-graph-found display">'+I18n.t('no_data_to_display')+'</div>');
    }
}

