function votes_n_voters_timeline_chart(selector, votes_data, voters_data) {
    $('.uc-no-graph-found').hide();
    $(".uc-graph-content").hide();
    $(".uc-graph-content" + selector).show();
    $(".uc-votes-graph-wrapper").trigger('resize');
    if (votes_data && votes_data.length > 0) {
        Highcharts.theme = {
            colors: ["#feb35e", "#05d5a7"]
        };
        Highcharts.setOptions({ lang: highchart_translation[I18n.locale] });
        Highcharts.setOptions(Highcharts.theme);
        votes_first_data_element = 0;
        if (votes_data && votes_data[0] && votes_data[0][0]) {
            votes_first_data_element = votes_data[0][0];
        }
        voters_first_data_element = 0;
        if (voters_data && voters_data[0] && voters_data[0][0]) {
            voters_first_data_element = voters_data[0][0];
        }
        zoom = 1 * 60 * 1000;
        pointInterval = 1 * 3600 * 1000;
        if (selector == "#last_hour_container") {
            zoom = 1 * 24 * 3600 * 1000;
            pointInterval = 1 * 60 * 1000;
        }
        graphOptions = {
            chart: {
                type: 'area',
                zoomType: 'x',
                spacingTop: 50,
                width: $(selector).width()
            },
            credits: {
                enabled: false
            },
            title: {
                text: ''
            },
            subtitle: {
                align: 'right',
                verticalAlign: 'top',
                text: document.ontouchstart === undefined ?
                    I18n.t('timeline_chart_desktop_subtitle') : I18n.t('timeline_chart_touchdevice_subtitle')
            },
            xAxis: {
                type: 'datetime',
                maxZoom: 1 * 24 * 3600 * 1000,
                dateTimeLabelFormats: {
                  millisecond: '%H:%M',
                	second: '%H:%M',
                	minute: '%H:%M',
                	hour: '%H:%M',
                	day: '%e %b',
                	week: '%e %b',
                	month: '%e %b %y',
                	year: '%e %b %y'
                },
                title: {
                    text: ''
                }
            },
            yAxis: {
                title: {
                    text: '',
                }
            },
            tooltip: {
                shared: true
            },
            plotOptions: {
                spline: {
                    marker: {
                        enabled: true
                    }
                }
            },
            exporting: {
                buttons: {
                    contextButton: {
                        align: 'right',
                        x: 0,
                        y: -50,
                        verticalAlign: 'top'
                    }
                }
            },
            legend: {
                verticalAlign: 'top',
                y: -30,
                floating: false,
                backgroundColor: '#FFFFFF'
            },
            series: [{
                name: I18n.t('votes_series_name'),
                // Define the data points. All series have a dummy year
                // of 1970/71 in order to be compared on the same x axis. Note
                // that in JavaScript, months start at 0 for January, 1 for February etc.
                data: [],
                pointInterval: pointInterval,
                pointStart: null,
                marker: {
                    enabled: true
                },
                fillColor: {
                    linearGradient: {
                        x1: 0,
                        y1: 0,
                        x2: 0,
                        y2: 1
                    },
                    stops: [
                        [0, Highcharts.getOptions().colors[0]],
                        [1, Highcharts.Color(Highcharts.getOptions().colors[0]).setOpacity(0).get('rgba')]
                    ]
                }

            }, {
                name: I18n.t('voters_series_name'),
                data: [],
                pointInterval: pointInterval,
                pointStart: null,
                marker: {
                    enabled: true
                },
                fillColor: {
                    linearGradient: {
                        x1: 0,
                        y1: 0,
                        x2: 0,
                        y2: 1
                    },
                    stops: [
                        [0, Highcharts.getOptions().colors[1]],
                        [1, Highcharts.Color(Highcharts.getOptions().colors[1]).setOpacity(0).get('rgba')]
                    ]
                }
            }]
        };
        graphOptions.xAxis.maxZoom = null;
        graphOptions.series[0]["data"] = votes_data;
        graphOptions.series[0]["pointInterval"] = pointInterval;
        graphOptions.series[0]["pointStart"] = votes_first_data_element;
        graphOptions.series[1]["data"] = voters_data;
        graphOptions.series[1]["pointInterval"] = pointInterval;
        graphOptions.series[1]["pointStart"] = voters_first_data_element;
        $(selector).highcharts(graphOptions);
        $(".uc-votes-graph-wrapper .uc-ajax-loader").remove();
    } else {
        $(selector).html("<div class='uc-no-graph-found'>"+I18n.t('no_data_to_display')+"</div>");
        $('.uc-no-graph-found').show();
    }

}
